import React, { Component, useState } from 'react'
import { Link } from 'react-router-dom'
import "bootstrap/dist/css/bootstrap.min.css";

import Cookies from 'universal-cookie';

//const url = "http://localhost:4000/empleados/";
const cookies = new Cookies();

class Navbar extends Component {

    cerrarSesion = () => {
        cookies.remove('id', { path: "/" });
        cookies.remove('nombre', { path: "/" });
        cookies.remove('apellido', { path: "/" });
        cookies.remove('cedula', { path: "/" });
        cookies.remove('contacto', { path: "/" });
        cookies.remove('direccion', { path: "/" });
        cookies.remove('cargo', { path: "/" });
        cookies.remove('tipoSangre', { path: "/" });
        cookies.remove('correo', { path: "/" });
        cookies.remove('usuario', { path: "/" });
        cookies.remove('contra', { path: "/" });
        window.location.href = './'
    }

    componentDidMount() {
        if (!cookies.get('usuario')) {
            window.location.href = './'
        }
    }
    render() {
        return (
            <>
                <nav id="encabezado" class="navbar navbar-expand-lg">
                    <div id="encabezado" class="container-fluid">
                        <div class="collapse navbar-collapse" id="navbarNav">
                            <ul class="navbar-nav">
                                <li class="nav-item">
                                    <a class="nav-link active" aria-current="page">
                                        <Link to='/home' className='navbar-logo' id="enlaces">
                                            Inicio
                                    </Link></a>
                                </li>
                                <li class="nav-item">
                                    <a class="nav-link">
                                        <Link to='/usuarios' className='nav-links' id="enlaces" >
                                            Usuarios
                                </Link>
                                    </a>
                                </li>
                                <li class="nav-item">
                                    <a class="nav-link">
                                        <Link to='/roles' className='nav-links' id="enlaces" >
                                            Roles
                                </Link>
                                    </a>
                                </li>
                                <li class="nav-item">
                                    <a class="nav-link">
                                        <Link to='/productos' className='nav-links' id="enlaces" >
                                            Productos
                                </Link>
                                    </a>
                                </li>
                                <li className='nav-item'>
                                    <button className="btn btn-primary" onClick={() => this.cerrarSesion()}>Cerrar sesion</button>
                                </li>
                            </ul>
                        </div>
                    </div>
                </nav>
            </>
        );
    }
}

export default Navbar;
